/*Table structure for table `tb_bidding` */

DROP TABLE IF EXISTS `tb_bidding`;

CREATE TABLE `tb_bidding` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `inquiry_id` int(10) unsigned NOT NULL,
  `pri` decimal(10,2) unsigned NOT NULL,
  `partband_id` varchar(5000) NOT NULL,
  `parttype_quality` tinyint(1) unsigned NOT NULL,
  `c` int(10) unsigned NOT NULL,
  `avi` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否现货',
  `qau` varchar(1000) NOT NULL COMMENT '有无质保',
  `pay` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '支付方式',
  `del` varchar(1000) NOT NULL COMMENT '交付方式',
  `pof` decimal(10,2) unsigned NOT NULL COMMENT '邮费',
  `pic1` varchar(500) DEFAULT NULL,
  `pic2` varchar(500) DEFAULT NULL,
  `pic3` varchar(500) DEFAULT NULL,
  `mes` varchar(2000) DEFAULT NULL,
  `aum` varchar(500) DEFAULT NULL,
  `create_time` datetime NOT NULL,
  `read_status` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `distance` decimal(10,2) unsigned NOT NULL COMMENT '距离',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=75 DEFAULT CHARSET=utf8;

/*Data for the table `tb_bidding` */

