/*Table structure for table `tb_coupon` */

DROP TABLE IF EXISTS `tb_coupon`;

CREATE TABLE `tb_coupon` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL COMMENT '名称',
  `price` int(10) unsigned NOT NULL COMMENT '额度',
  `need_min` int(10) unsigned NOT NULL COMMENT '最低满足消费',
  `get_type` tinyint(1) unsigned NOT NULL COMMENT '领取方式',
  `get_date` date DEFAULT NULL COMMENT '领取时间(领取方式为定时才有效)',
  `get_count` int(10) unsigned NOT NULL COMMENT '领取数量',
  `begin_date` date NOT NULL COMMENT '开始时间',
  `end_date` date NOT NULL COMMENT '结束时间',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否可领取',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

/*Data for the table `tb_coupon` */

/*Table structure for table `tb_credit_level` */

DROP TABLE IF EXISTS `tb_credit_level`;

CREATE TABLE `tb_credit_level` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL,
  `point` int(10) unsigned NOT NULL,
  `level` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=20 DEFAULT CHARSET=utf8;

