/*Table structure for table `tb_inquiry` */

DROP TABLE IF EXISTS `tb_inquiry`;

CREATE TABLE `tb_inquiry` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `parttype_id` int(10) unsigned NOT NULL,
  `partband_id` varchar(5000) NOT NULL,
  `car_id` int(10) unsigned NOT NULL,
  `c` int(10) unsigned NOT NULL,
  `pic1` varchar(500) DEFAULT NULL,
  `pic2` varchar(500) DEFAULT NULL,
  `pic3` varchar(500) DEFAULT NULL,
  `mes` varchar(2000) DEFAULT NULL,
  `aum` varchar(500) DEFAULT NULL,
  `create_time` datetime NOT NULL,
  `end_time` datetime NOT NULL,
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `parttype_quality` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `area_id` int(10) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=120 DEFAULT CHARSET=utf8;

