/*Table structure for table `tb_order` */

DROP TABLE IF EXISTS `tb_order`;

CREATE TABLE `tb_order` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `num` varchar(50) NOT NULL,
  `sell_user_id` int(10) unsigned NOT NULL,
  `sel` varchar(2000) NOT NULL,
  `buy_user_id` int(10) unsigned NOT NULL,
  `buy` varchar(2000) NOT NULL,
  `pri` decimal(10,2) unsigned NOT NULL,
  `par` varchar(200) NOT NULL,
  `ban` varchar(5000) NOT NULL,
  `car` varchar(2000) NOT NULL,
  `c` int(10) unsigned NOT NULL,
  `parttype_quality` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `avi` tinyint(1) unsigned NOT NULL,
  `qau` varchar(1000) NOT NULL,
  `pay` tinyint(1) unsigned NOT NULL,
  `del` varchar(1000) NOT NULL,
  `adr` varchar(2000) NOT NULL,
  `pof` decimal(10,2) unsigned NOT NULL,
  `bil` varchar(2000) NOT NULL,
  `pic1` varchar(500) DEFAULT NULL,
  `pic2` varchar(500) DEFAULT NULL,
  `pic3` varchar(500) DEFAULT NULL,
  `create_time` datetime NOT NULL,
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `buyer_score` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `comments` varchar(2000) DEFAULT NULL,
  `matchs` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `service` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `speed` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `update_time` datetime NOT NULL,
  `real_price` decimal(10,2) unsigned NOT NULL,
  `user_coupon_id` int(10) unsigned NOT NULL,
  `is_freeze` tinyint(1) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=47 DEFAULT CHARSET=utf8;

/*Data for the table `tb_order` */

/*Table structure for table `tb_out` */

DROP TABLE IF EXISTS `tb_out`;

CREATE TABLE `tb_out` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL COMMENT '用户',
  `bank_name` varchar(100) NOT NULL COMMENT '银行名称',
  `bank_address` varchar(1000) NOT NULL COMMENT '开户行所在地',
  `bank_no` varchar(50) NOT NULL COMMENT '卡号',
  `bank_user` varchar(100) NOT NULL COMMENT '开户名称',
  `price` decimal(10,2) unsigned NOT NULL COMMENT '额度',
  `request_time` datetime NOT NULL COMMENT '申请时间',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态 0-未处理1-已提现',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

/*Data for the table `tb_out` */

/*Table structure for table `tb_partband` */

DROP TABLE IF EXISTS `tb_partband`;

CREATE TABLE `tb_partband` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `nam` varchar(100) NOT NULL,
  `mad` varchar(100) NOT NULL,
  `pic` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=119 DEFAULT CHARSET=utf8;

/*Data for the table `tb_partband` */

/*Table structure for table `tb_parttype` */

DROP TABLE IF EXISTS `tb_parttype`;

CREATE TABLE `tb_parttype` (
  `id` bigint(15) unsigned NOT NULL AUTO_INCREMENT,
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `nam` varchar(100) NOT NULL,
  `pic` varchar(500) NOT NULL,
  `par` int(10) unsigned NOT NULL DEFAULT '0',
  `ban` varchar(5000) NOT NULL,
  `h` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `cars` longtext,
  `is_select_car` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `is_select_quality` tinyint(1) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
